import React from "react";
import "./App.css";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";
import Nav from "../Nav/Nav";

import "bootstrap/dist/css/bootstrap.css";

var divStyle = {
  color: "black"
};

function App() {
  return (
    <div className="App" style={divStyle}>
      <Header />
      <Nav />
      <Footer />
    </div>
  );
}

export default App;
